%[text] # Normalizing images by CSF and WM covariates
%[text] This live script explains how normalize\_gm\_by\_wm\_csf reduces image-wide zero-point shifts and scaling differences by modeling gray matter intensities as a function of global white matter and CSF values. This can improve sensitivity in second-level analyses by removing global nuisance variance before group modeling (including mixed effects analyses with fitlme\_voxelwise).
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%[text] ## Why normalize using WM and CSF
%[text] Global shifts in gray matter can arise from scanner drift, acquisition differences, or preprocessing artifacts. By estimating subject-level additive shifts (from CSF and WM medians) and multiplicative scaling (from GM, WM, and CSF MADs), normalize\_gm\_by\_wm\_csf aligns global intensity distributions across subjects without changing spatial patterns within gray matter.
%[text] This normalization is especially helpful when you plan to compare group-level maps or fit second-level models, because it reduces between-subject variance unrelated to neural signal. The normalized images can then be analyzed with standard t-tests or with voxelwise mixed effects models such as fitlme\_voxelwise.
%[text] ## Check for global GM, WM, and CSF shifts
%[text] First, extract global summaries from gray matter, white matter, and CSF to assess image-wide shifts.
% Load example data
imgs = load_image_set('emotionreg'); %[output:77c26903]

% Extract mean GM, WM, and CSF values for each image
% values is N_images x 3 for GM, WM, and CSF
[values, components] = extract_gray_white_csf(imgs); %[output:3f8bbd21]

% Quick diagnostic plot of tissue means
figure; plot(values, 'o-'); %[output:37a7e633]
legend({'GM', 'WM', 'CSF'}, 'Location', 'best'); %[output:37a7e633]
xlabel('Image'); ylabel('Mean intensity'); %[output:37a7e633]
title('Global tissue means by image'); %[output:37a7e633]
%[text] The values matrix reports one mean per tissue class for each image. Large offsets or scaling differences across images indicate global shifts that can inflate between-subject variance in group-level analyses.
%[text] The components output contains the top five components within each tissue class and can be used to diagnose structured noise. For normalization, the key signal is in the global GM, WM, and CSF summaries.
%[text] ## Normalize GM using WM and CSF covariates
%[text] Run normalization and compare the statistical results before and after.
% T-test on un-normalized data
t = ttest(imgs); %[output:915ed580]
histogram(t); %[output:76563865]
set(gcf, 'Tag', 'unnormalized');

% Normalize and re-run t-test
imgs_normalized = normalize_gm_by_wm_csf(imgs); %[output:0391b175] %[output:25450f2d] %[output:69080747]
t2 = ttest(imgs_normalized); %[output:46484b05]
histogram(t2); %[output:933fd457]
%%
% Compare the t-values
figure; plot(t.dat, t2.dat, '.'); %[output:8677fc84]
hold on; plot([-10 10], [-10 10], '--', 'Color', 'k'); %[output:8677fc84]
xlabel('t-values before normalization'); ylabel('t-values after normalization');  %[output:8677fc84]
% or:
h = image_scatterplot(t, t2, 'pvaluebox', 0.005, 'colorpoints'); %[output:4c0b4dbf]
xlabel('t-values before normalization'); ylabel('t-values after normalization');  %[output:4c0b4dbf]
set(gca, 'FontSize', 16) %[output:4c0b4dbf]
%[text] ### Interpreting the comparison
%[text] In the scatterplot comparison, points above the diagonal indicate voxels with larger t-values after normalization. When using image\_scatterplot with colorpoints, colored points indicate voxels that are significant in both maps. Blue points are those that become significant or show stronger effects before normalization, while pink points indicate voxels that become significant or show stronger effects after normalization. In this example, pink points highlight voxels where statistical sensitivity and power improve after removing global shifts and scaling differences.
%[text] ## Link to voxelwise mixed effects models
%[text] After normalization, you can pass the normalized fmri\_data object into fmri\_data.regress(),  fmri\_data.fitlme\_voxelwise(), or similar tools for  statistical GLM modeling. This preserves voxelwise signal patterns while reducing nuisance variance tied to global WM and CSF values.

